import React from 'react';
import { Table, Grid } from 'semantic-ui-react';
import styles from '../../../styles';

const amountsStyle = {
  backgroundColor: styles.colors.mid
};

const notBold = {
  fontWeight: 200
};

export const BudgetOverviewAmounts = () => {
  return (
    <Table.HeaderCell colSpan='3' textAlign="center" style={amountsStyle}>
      <Table.Row>
        <Table.Cell>€1000</Table.Cell>
        <Table.Cell style={notBold}>Available Funds</Table.Cell>
      </Table.Row>  
      <Table.Row>
        <Table.Cell>€-100</Table.Cell>
        <Table.Cell style={notBold}>Overspent Last Month</Table.Cell>
      </Table.Row>  
      <Table.Row>
        <Table.Cell>€950</Table.Cell>
        <Table.Cell style={notBold}>Budget</Table.Cell>
      </Table.Row>  
      <Table.Row>
        <Table.Cell>€50</Table.Cell>
        <Table.Cell style={notBold}>For Next Month</Table.Cell>
      </Table.Row>  
    </Table.HeaderCell>
  )
};
